import logo from './logo.svg';
import './App.css';
import './css/bootstrap.min.css';
import Gambar from './Gambar';
function App() {
  var nama = <i>Lannister</i>
  return (
    <div>
      <header>
        <div className="container">
         <img className="pt-2" src={logo} alt="logo" width="60" height="70"/>
         <p className="ucapan fs-1">Hello, {nama}</p>
         <p className="toko fs-5">Toko Buah Online</p>
         <table class="table table-borderless">
           <tbody>
             <tr>
               <td><img className="" src={Gambar.Apel} alt="logo"/></td>
               <td><img className="" src={Gambar.Pisang} alt="logo"/></td>
               <td><img className="" src={Gambar.Durian} alt="logo"/></td>
             </tr>
             <tr>
               <td scope="row"></td>
               <td></td>
               <td></td>
             </tr>
           </tbody>
         </table>
        </div>
      </header>
    </div>
  );
}

export default App;
